</Script><script type=text/javascript>
        $(function() {

            var Page = (function() {

                var $navArrows = $('#nav-arrows').hide(),
                    $navDots = $('#nav-dots').hide(),
                    $nav = $navDots.children('span'),
                    $shadow = $('#shadow').hide(),
                    slicebox = $('#sb-slider').slicebox({
                        onReady: function() {

                            $navArrows.show();
                            $navDots.show();
                            $shadow.show();

                        },
                        speed: 1300,
                        interval: 4000,
                        orientation: 'v',
                        cuboidsCount: 7,
                        autoplay: true,
                        onBeforeChange: function(pos) {
                            /*$('#nav-arrows').find('a.prev').animate({left:"25px"});*/
                            /*$('#nav-arrows').find('span.lowerImg_l').css('z-index','3').animate({left:"43px",width:'49px'});
								$('#nav-arrows').find('a.next').animate({right:"25px"});
                                $('#nav-arrows').find('span.lowerImg_r').css('z-index','3').animate({right:"43px",width:'49px'});*/
                            $nav.removeClass('nav-dot-current');
                            $nav.eq(pos).addClass('nav-dot-current');
                        },
                        onAfterChange: function(pos) {
                            /*$('#nav-arrows').find('a.next').animate({right:"47px"});*/

                            /*$('#nav-arrows').find('span.container1 span.lowerImg_l').css('overflow','hidden').animate({left :"64px",width:'0px'},400);
								$('#nav-arrows').find('a.prev').animate({left:"47px"});
								$('#nav-arrows').find('span.container1 span.lowerImg_r').css('overflow','hidden').animate({right :"64px",width:'0px'},400);*/
                        }
                    }),

                    init = function() {

                        initEvents();

                    },
                    initEvents = function() {

                        // add navigation events
                        $navArrows.children(':first').on('click', function(event) {
                            event.preventDefault();
                            //$('#nav-arrows').find('a.prev').animate({left:"47px"});
                            //$('#nav-arrows').find('span.container1 span.lowerImg_r').css('overflow','hidden').animate({right :"64px",width:'0px'},400);
                            slicebox.next();
                            return false;

                        });

                        $navArrows.children(':last').on('click', function(event) {
                            //$('#nav-arrows').find('a.next').animate({right:"47px"});

                            /// $('#nav-arrows').find('span.container1 span.lowerImg_l').css('overflow','hidden').animate({left :"64px",width:'0px'},400);
                            event.preventDefault();
                            slicebox.previous();
                            return false;

                        });

                        $nav.each(function(i) {

                            $(this).on('click', function(event) {
                                event.preventDefault();
                                var $dot = $(this);

                                if (!slicebox.isActive()) {

                                    $nav.removeClass('nav-dot-current');
                                    $dot.addClass('nav-dot-current');

                                }

                                slicebox.jump(i + 1);
                                return false;

                            });

                        });

                    };

                return {
                    init: init
                };

            })();

            Page.init();

        });
    </script></head> <body> <!--Wrapper--> <Script Language='Javascript'>
